import React, { useState, useEffect } from 'react';
import axios from 'axios';

function RssFeed() {
  const [rssContent, setRssContent] = useState('');

  useEffect(() => {
    // Realizar la petición GET al archivo rss.xml
    axios.get('/path/to/rss.xml')
      .then(response => {
        // Obtener el contenido del archivo rss.xml
        const content = response.data;
        setRssContent(content);
      })
      .catch(error => {
        console.error('Error al cargar el archivo rss.xml:', error);
      });
  }, []);

  return (
    <div>
      {/* Mostrar el contenido del archivo rss.xml */}
      <pre>{rssContent}</pre>
    </div>
  );
}

export default RssFeed;
